In order to use teloxide you first need to create a Rust project with cargo : $ cargo new my-first-bot --bin Note: this book assumes that you already have basic knowledge of Rust and have cargo installed. If you don't have it, we recommend reading The Rust Book . Teloxide is an async library, so in order to use it you need an async runtime like tokio . Add tokio and teloxide dependencies to Cargo.toml generated by cargo new: # Cargo.toml [dependencies]
tokio = { version = "1.17", features = ["rt-multi-thread", "macros"] }
teloxide = "0.9" Note: teloxide currently requires tokio and won't work with other runtimes. Now you can start writing your bot. First, you'll need to create an async entry point to the program: // This is needed to run `async` main function via tokio runtime
#[tokio::main]
// Returning result from main allows for easier error handling
async fn main() -> Result<(), Box<dyn std::error::Error>> { // ... Ok(())
} Then, you can create a bot using Bot::new and auto_send extension (we'll cover what auto_send does in later chapters): use teloxide::prelude::*; # #[tokio::main]
# async fn main() -> Result<(), Box<dyn std::error::Error>> {
# // Replace TOKEN with the token you've got when creating the bot
let bot = Bot::new("TOKEN").auto_send();
# # Ok(())
# } Then, try sending yourself a message: # use teloxide::{prelude::*, ChatId};
# #[tokio::main]
# async fn main() -> Result<(), Box<dyn std::error::Error>> {
# let bot = Bot::new("TOKEN").auto_send();
# // replace 0 with your user id
let your_id = ChatId(0);
bot .send_message(your_id, "Hi!") // `.await` is needed to wait for an async operation // `?` propagates possible errors .await?; # # Ok(())
# } Note: you can get your id from @ShowJsonBot (message -> from -> id). Note: Telegram bots can't initiate a dialog, so you need to write to the bot first. Now you can run the bot and it should send you a "Hi!" message: cargo run is executed in a console and then the bot sends a "Hi!" message

