A bot that just sends messages may be all you need, but often you want to react to the user's input. For this teloxide provides a variety of constructs. The simplest option to process user's input is called "repl". To use it you just need to provide a bot and a function to it. Then, the function will be executed on each message from the user: # use teloxide::prelude::*;
# #[tokio::main]
# async fn main() -> Result<(), Box<dyn std::error::Error>> {
# let bot = Bot::new("TOKEN").auto_send();
# teloxide::repl(bot, |message: Message, bot: AutoSend<Bot>| async move { // There are non-text messages, so we need to use pattern matching if let Some(text) = message.text() { // Echo text back into the chat bot.send_message(message.chat.id, text).await?; } // respond is an alias to `Ok()` with a error type compatible with teloxide respond(())
}).await;
# # Ok(())
# } Bot repeating every message after the author. To stop the bot running in a repl, you can press ctrl + C. Note that it can take some time to stop the bot: cargo run is executed in a console and then Ctrl+C is immediately pressed, but the bot doesn't stop for 20-30 seconds

