We've already sent simple requests in previous chapters, but we didn't explain how they work. In this chapter we'll dive deep into how requests are implemented in teloxide. When in previous chapters we've called send_message, the method came from a trait called Requester . Requester is a trait that is implemented by Bot (and bot adaptors , more on that in the next chapter) and is included in the prelude. use teloxide::prelude::{*, ChatId}; # #[tokio::main]
# async fn main() -> Result<(), Box<dyn std::error::Error>> {
# let bot = Bot::new("TOKEN").auto_send();
# # // replace 0 with your user id
# let your_id = ChatId(0);
bot .send_message(your_id, "Hi!") .await?; # # Ok(())
# } send_message has optional parameters that can be provided like this: use teloxide::prelude::*; # #[tokio::main]
# async fn main() -> Result<(), Box<dyn std::error::Error>> {
# let bot = Bot::new("TOKEN").auto_send();
# # // replace 0 with your user id
# let your_id = ChatId(0);
bot .send_message(your_id, "Hi!") .protect_content(true) // <-- optional parameter! .await?; # # Ok(())
# } Normally you'd also need to call .send() before .await, but .auto_send() on the bot allows you to not do that (more on that later).

