Requests parameters are stored in plain structures called payloads, for example: // teloxide::payloads
pub struct SendMessage { pub chat_id: ChatId, pub text: String, pub parse_mode: Option<ParseMode>, // optional parameters use `Option<_>` pub entities: Option<Vec<MessageEntity>>, pub disable_web_page_preview: Option<bool>, pub disable_notification: Option<bool>, pub protect_content: Option<bool>, pub reply_to_message_id: Option<i32>, pub allow_sending_without_reply: Option<bool>, pub reply_markup: Option<ReplyMarkup>,
} Such structures implement Payload trait that specifies the name of the method and the return type: impl Payload for SendMessage { type Output = Message; const NAME: &'static str = "SendMessage"
} For all payloads there is also a <Payload>Setters trait that is implemented for any HasPayload<Payload = <Payload>>. *Setters traits add builder-functions that allow to change the payload (like protect_content in the example above). All setter traits are reexported "as _" in the prelude, so you don't have to import traits every time you want to use an optional parameter. HasPayload is a trait that just allows to get a & or &mut reference to a payload. HasPayload is implemented for all payloads and simply returns self.
